import React from "react";
import "./StatusDiv.css";

function StatusDiv({ invoiceStatus, invoiceUpdated }) {
  if (invoiceUpdated) {
    return (
      <div className={`status-container Paid-container`}>
        <div className={`circle-icon Paid-circle`}></div>
        <p className={`status-text Paid-text`}>Paid</p>
      </div>
    );
  }

  return (
    <React.Fragment>
      <div className={`status-container ${invoiceStatus}-container`}>
        <div className={`circle-icon ${invoiceStatus}-circle`}></div>
        <p className={`status-text ${invoiceStatus}-text`}>{invoiceStatus}</p>
      </div>
    </React.Fragment>
  );
}

export default StatusDiv;
